import React from 'react';

class Documents extends React.Component {
    componentDidUpdate() {
        const element = document.getElementById('#documents');

        element.classList.add("active");
    }

    render() {
        return (
            <div className="Documents">Documents</div>
        );
    }
};

export default Documents;
